458816274 Please update this issue to avoid closure due to inactivity rvema
458993397 We found a workaround. By increasing the timeout the connection is kept opened and no premature EOF.
```
public class RestOperationsSupplier implements Supplier<RestOperations> {
    @Override
    public RestOperations get() {
    	HttpComponentsClientHttpRequestFactory requestFactory = new HttpComponentsClientHttpRequestFactory();
        requestFactory.setConnectTimeout(500000);
        requestFactory.setReadTimeout(500000);
        return new RestTemplate(requestFactory);
    }
}
```
What you really want to do is to paginate the requests. fidelcoria
