431257128 @caiohcl 
It worked for me 

To make it work, the below code changes are required

The sample request payload for Jira widget worked as part of the **/api/dashboard/remoteCreate** or
**/api/dashboard/remoteUpdate** api calls

 "featureEntries":[
      {

         "toolName":"Jira",
         "description":"Metrics Service Team(MST)",
         "pushed":false,
         "options":{
            "teamName":"MST",
            "featureTool":"Jira",
             "projectName" : "Metrics Service Team(MST)",
             "projectId" : "15258144130",
             "teamId" : "15258144034",
             "estimateMetricType":"count",
             "listType":"issues",
              "showStatus" : {
                    "kanban" : false,
                    "scrum" : true
                }
         }
      }
   ],

You have to make the below two code changes to the 

1) **DashboardRemoteRequest.java**
Replace the following inner class 

**FROM**
 public static class FeatureEntry extends Entry {

        @Override
        public CollectorType getType() {
            return CollectorType.AgileTool;
        }

        @Override
        public String getWidgetId() {
            return "feature0";
        }

        @Override
        public String getWidgetName() {
            return "feature";
        }

        **@Override
        public Map<String, Object> toWidgetOptions() {
            return null;
        }**
    }

**TO**
 public static class FeatureEntry extends Entry {

        @Override
        public CollectorType getType() {
            return CollectorType.AgileTool;
        }

        @Override
        public String getWidgetId() {
            return "feature0";
        }

        @Override
        public String getWidgetName() {
            return "feature";
        }

        @Override
        public Map<String, Object> toWidgetOptions() {
    			Map<String, Object> opts = new HashMap<>();
    			opts.put("id", getWidgetId());
    			 for (String key : options.keySet()) {
    	                opts.put(key, options.get(key));
    	         }
    			return opts;

    		}

    }

2) Add the "featureEntries" to the getAllEntries() method and try the dashboard create API from postman first to see the difference. I have my Jira widget get created as expected with the collected data. Thanks
 public List<Entry> getAllEntries() {
        List<Entry> all = new ArrayList<>();
        all.addAll(buildEntries);
        all.addAll(featureEntries);
        all.addAll(codeRepoEntries);
        all.addAll(staticCodeEntries);
        all.addAll(libraryScanEntries);
        all.addAll(securityScanEntries);
        all.addAll(functionalTestEntries);
        all.addAll(deploymentEntries);
        return all;
    }
