column2:
Hey!!

I've been working on automate the creation of team dashboards through Hygieia API, calling the POST /dashboard/remoteCreate API.
I can successfully run and create the team dashboard on swagger. However, when I run the same curl code on my cmd, I get the following unauthorized message:

> "status":401,"error":"Unauthorized","message":"Full authentication is required to access this resource","path":"/api/dashboard/remoteCreate"

The curl command is the following:

`curl -X POST --header 'Content-Type: application/json' --header 'Accept: application/json' -d '{
  "metaData": {
    "applicationName": "String new application",
    "componentName": "String new application",
    "owner": {
      "authType": "STANDARD",
      "username": "admin"
    },
    "template": "testing",
    "title": "dash new application",
    "type": "team"
  }
}' 'http://localhost:9080/api/dashboard/remoteCreate?api_key=$apiKey'`

Have anyone faced the same problem? Did I forget to include some information?

column11:
415790761 @caiohcl - you need to create an api token for yourself. Log in as admin, then go your admin settings. Then click Generate API tokens > New. Enter the username you want to use then set your expiration date to an acceptable future date, click Create. Write you token down as you will not be able to see it again. Now take that token and insert it into this command: `echo 'PasswordIsAuthToken:{"apiKey":"<api-token-you-created>"} | base64`. Save the output.

Now when you issue create dashboard requests you need to set two headers. `apiUser` and `Authorization`. `apiUser` value is the user you create and `Authorization` value will be `apiToken <base64 encoded result>`. matthewbeasley
415815348 @matthewbeasley , it worked! Thank you!!! caiohcl
