486332836 Hey @alekya123 
Following the curl command I've been using. It creates a brand new team dashboard, adding Build, Deploy, Code Quality (sonar), Jira and Bitbucket widgets.

`curl -X POST --header 'Content-Type: application/json' --header 'apiUser: <apiUser>' --header 'Authorization: apiToken <apiToken>'  --header 'Accept: application/json' -d '{
  "buildEntries": [
    {
      "description": "<jenkins_job_name>",
      "niceName":"<niceName>",
      "options": {
         "instanceUrl": "<build_url>",
         "jobName": "<jenkins_job_name>",
         "jobUrl": "<jenkins_job_url>"
         },
      "pushed": false,
      "toolName": "Hudson"
    }
  ],
  "deploymentEntries":[
  {
    "description": "<application_name>",
    "niceName": "<niceName>",
    "pushed": true,
    "toolName": "Jenkins",
    "options": {
    	"applicationName": "<application_name>",
        "instanceUrl": "<deploy_url>"
    }
  }
  ],
  "staticCodeEntries":[
    {
      "description": "<sonar_project_Name>",
      "pushed": false,
      "options":{
      	"projectName": "<sonar_project_Name>",
        "instanceUrl":"<sonar_url>"
        },
      "toolName":"Sonar"
    }
  ],
  "codeRepoEntries": [
    {
      "description": "Hygieia-dashboard",
      "options": {
         "password": "<pwd>",
         "userID": "<user>",
         "url": "<code_repo_url>",
         "branch": "<branch_name>"
       },
      "pushed": false,
      "toolName": "Bitbucket"
    }
  ],
 "featureEntries": [
  {
     "toolName":"Jira",
     "description": "<jiraProjectName>",
     "pushed": false,
     "options":{
     	"teamName": "<$jiraTeamName"'",
        "featureTool":"Jira",
        "projectId":"<projectID>",
        "teamId":"<teamId>",
        "projectName" : "'"$jiraProjectName"'",
        "estimateMetricType":"count",
        "listType":"issues",
        "sprintType":"kanban",
        "showStatus" : {
           "kanban" : true,
	   "scrum" : false
        }
     }
  }
  ],
  "metaData": {
    "applicationName": "'"$dashTitle"'",
    "componentName": "'"$dashTitle"'",
    "owner": {
      "authType": "STANDARD",
      "username": "admin"
    },
    "template": "<template_name>",
    "title": "'"$dashTitle"'",
    "type": "team"
  }
}' `echo $hygieiaURL`':9080/api/dashboard/remoteCreate'` caiohcl

